import styled from '@emotion/styled'
import { Input } from '@tablecheck/tablekit-input'
import { Spinner, SpinnerSize } from '@tablecheck/tablekit-spinner'

import { Headline, MainWrapper, PageContent, PageWrapper } from 'Layouts'
import { Children } from 'react'

export const SearchPageContent = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`

export const SearchInput = styled(Input)`
  width: min(80%, 500px);
  box-shadow: inset 0px 0px 0px 1px rgb(0 0 0 / 11%);
  overflow-y: scroll;
  max-height: 50vh;
`

export const SearchSpinner = styled(Spinner)`
  margin-top: 30px;
  margin-bottom: 30px;
  width: 100%;
`
